import ListGroup from 'react-bootstrap/ListGroup';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
//import './src/Styles/ServerList.css';
function ServerList() {
    const alertClicked = () => {
        alert('You clicked the third ListGroupItem');
    };

    return (
    <Container fluid>
        <Row>
        <Col sm={2}>
        <ListGroup defaultActiveKey="#link1">
            <ListGroup.Item id="id1" type="checkbox" action href="#link1">
                Коммутатор 1
            </ListGroup.Item>
            <ListGroup.Item id="id2" type="checkbox" action href="#link2" >
                Коммутатор 2
            </ListGroup.Item>
            <ListGroup.Item action onClick={alertClicked}>
                Коммутатор 3
            </ListGroup.Item>
            <ListGroup.Item action href="#link2" >
                Коммутатор 4
            </ListGroup.Item>
            <ListGroup.Item action href="#link2" >
                Коммутатор 5
            </ListGroup.Item>
            <ListGroup.Item action href="#link2" >
                Коммутатор 6
            </ListGroup.Item>
        </ListGroup>
        </Col>
        </Row>
    </Container>
    );
}

export default ServerList;
